import React from 'react'
import '/article.css'

const Article = ({imgUrl}) => {
  return (
    <div className='a__blog-container_article'>
        <div className='a__blog-container_article-image'>
            <img src={imgUrl} alt="Kursus image" />
        </div>
    </div>
  )
}

export default Article
